import React from "react";
import './navigation-item.css'

const NavItem=(props)=>{
      let mas=[]
      for(let i=0;i<18;i++){
          mas.push(i)
      }

        return(
             <div className="navItem">
                 <div>{mas[props.icon]}{props.label} </div>
                 <div>{'>'}</div>
             </div>
            )
}
export default NavItem
